import React from 'react';

const FriendList = ({ friends }) => {
  return (
    <div>
      {friends && friends.map(friend => (
        <div key={friend.id}>
          <h3>{friend.name}</h3>
          <p>{friend.age}</p>
        </div>
      ))}
    </div>
  );
};

export default FriendList;
